try:
    # Convert strings to PauliStrings
    pauli_stabilizers = [stim.PauliString(s) for s in stabilizers]
    
    # allow_underconstrained=True allows creating a tableau even if not full rank
    # However, to prepare a state, we probably want to fix the remaining degrees of freedom.
    # If we just get a tableau, we can convert it to a circuit.
    # The tableau T maps Z_k to Stabilizer_k.
    # If we apply T to |0...0>, we get a state stabilized by Stabilizer_k.
    # But wait, if there are 114 stabilizers, what about the 115th qubit?
    # T will have 115 outputs. 114 are the stabilizers. The last one will be something else.
    # If we prepare |0...0>, we are in +1 eigenstate of Z_k.
    # After T, we are in +1 eigenstate of T(Z_k) = Stabilizer_k.
    # So this should work.
    
    t = stim.Tableau.from_stabilizers(pauli_stabilizers, allow_underconstrained=True)
    print("Found tableau!")
    
    c = t.to_circuit()
    
    # Print the circuit to stdout so I can grab it
    print("---CIRCUIT START---")
    print(c)
    print("---CIRCUIT END---")
    
except Exception as e:
    print(f"Error: {e}")

